import React, { useState } from 'react'
import { userState } from 'react'


function Tasks(props) {
    
    return (
        <>
          {props.tasks.map((task) => (
              <h3 key = {task.id}>{task.text}</h3>
          ))}  
        </>
    )
}

export default Tasks
